import React from "react";
import "./Feed.css";
import StoryReel from "./StoryReel";
import MessageSender from "./MessageSender";
import Post from "./Post";
import { Avatar } from "@material-ui/core";

function Feed() {
  return (
    <div className="feed">
      <StoryReel />
      <MessageSender />

      <Post
        profilePic={<Avatar src="" />}
        message="Hello World!"
        timestamp="this is the timestamp"
        username="RayanDiouf"
        image="https://www.google.com/url?sa=i&url=https%3A%2F%2Funsplash.com%2Fs%2Fphotos%2Fcomputer-code&psig=AOvVaw18plt36mhqT5PTWBPHZn4M&ust=1638218622883000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCMjcvYr2u_QCFQAAAAAdAAAAABAD"
      />
    </div>
  );
}

export default Feed;
